  function proxySend(
    address _operator, 
    address _to, 
    uint _amount, 
    bytes _userData
  ) public {
    authorizeOperator(_operator);
    //todo find best practice for using preventlocking instead of hardcoding true below
    callProxy(
      _operator, 
      _to, 
      _amount, 
      _userData, 
      true
    );
    revokeOperator(_operator);
  }

  function callProxy(
    address _operator,
    address _to,
    uint256 _amount,
    bytes _userData,
    bool _preventLocking
  ) private {
    //require(_approvedFor(_operator, _tokenId));
    address recipientImplementation = interfaceAddr(_operator, "IProxyPayment");
    if (recipientImplementation != 0) {
      IProxyPayment(recipientImplementation).proxySend(
        msg.sender, 
        _to, 
        _amount, 
        _userData
      );
    } else if (_preventLocking) {
      require(isRegularAddress(_to));
    }
  }
}
